સબમિટ ડાઉનલોડ ઇન્યૂમરેશન બ્લોક વિગતો * નવી ગણતરી બ્લોક ડેટા ડાઉનલોડ કરવા માટે, પ્રથમ સમન્વય કરો. તમારી હાલની ગણતરી બ્લોક ડેટા. ડાઉનલોડ પસંદ કરેલ સ્થાન માન્ય નિવાસીઓમાં સમન્વયિત કરવા માટે ક્લિક કરો સમન્વયન બિન આધાર માન્ય નિવાસીઓમાં રીસેટ ઇન્યૂમરેશન બ્લોક ઘરગથ્થુ 4-અંકનો PIN દાખલ કરો PIN ની પુષ્ટિ રીસેટ કોઈ સભ્ય મળી અપડેટ RSBY સભ્યો ભૂલ / સબમિટ સબમિટ પૂર્ણ નોંધણી આઈડી 29 આંકડાના નોંધણી આઈડી દાખલ
નોંધણી માં નામ પુડુચેરી પુડુચેરી પુડુચેરી તાલુકાના ગણતરીદાર બ્લોક પસંદ કરો હાઉસ ડેટા મેળવો ગામ / નગર પસંદ કરો વોર્ડ પસંદ ડેટા મેળવવા જ્યારે કૃપા કરીને રાહ જુઓ સંપૂર્ણ માહિતી સર્વર માંથી મેળવ્યાં કરવામાં આવી રહી છે અને સ્થાનિક ડેટાબેઝમાં નકલ હા કોઈ તમારો મોબાઇલ નંબર દાખલ તમારી નોંધણી ID દાખલ તમારા ઈદ દાખલ ઉદા: (dd / mm / YYYY hh: mm: ss) RSBY ફૂલદાની કોઈ ડેશબોર્ડ શોધ / ડાઉનલોડ SECC સભ્ય RSBY ડેટા એચએચડી કોઈ નામ (સભ્ય ID) સંબંધ પિતાનું નામ માતાનું ડીઓબી જાતિ વૈવાહિક સ્થિતિ આધાર કાર્ડ નંબર વ્યવસાય આરએસબીવાય અથવા રાજ્ય વીમા નં રેશન કાર્ડ નંબર સભ્ય સ્થિતિ અપડેટ 1111 નામ (સભ્ય આઈડી) ઘરગથ્થુ સ્થિતિ પસંદ કુટુંબ સ્થિતિ વડા પસંદ નવા વડા પસંદ અન્ય સભ્ય માતાનો સેવ લોક આરએસબીવાય નિવાસીઓમાં માન્ય સભ્ય માતાનો નોન માન્ય સભ્ય માતાનો સભ્યની નામાંકન માટે નામાંકન નામ નોમિની નામ દાખલ કરો સંબંધ નામ દાખલ ગાર્ડિયન નામ વાલી નામ દાખલ કરો ચકાસેલી નથી PIN દાખલ કરો જાઓ ઑફલાઇન હાઉસ નં 004 માટે યાદી અપડેટ કરી. ઇન્ટરનેટ મારફતે માન્ય એસએમએસ દ્વારા માન્ય પાછળથી માન્ય ફોટો કૅપ્ચર કેપ્ચર જીપીએસ સ્થાન પ્રિંટ પૂર્વાવલોકનને સબમિટ ઇ સાઇન
