આધાર નંબર દાખલ કરો માન્ય આધાર નંબર દાખલ કરો આધાર તરીકે જન્મ તારીખ દાખલ કરો આધાર તરીકે લિંગ દાખલ કરો આધાર તરીકે નામ દાખલ કરો આધાર તરીકે યોગ્ય આધાર નંબર અને નામ દાખલ કરો યુઆઇડીએઆઇ સર્વર માંથી કનેક્ટ કરવામાં અક્ષમ, કૃપા કરી ફરી પ્રયાસ કરો. કનેક્શન સમાપ્ત, કૃપયા ફરી પ્રયાસ કરો નવી ગણતરી બ્લોક પસંદ કરો અપડેટ રદ કરો પિન દાખલ કરો સાચી PIN દાખલ કરો અપડેટ ઉપલબ્ધ આવૃત્તિ વર્તમાન આવૃત્તિ : અપડેટ સંસ્કરણ: મોબાઇલ ઉપલબ્ધ નથી નેટવર્ક ઓટીપી દાખલ માન્ય ઓટીપી દાખલ
// 5.april // dropdown menu પ્રોફાઇલ લૉગ આઉટ ઘર 4-અંકની PIN દાખલ કરો પ્રિંટ ઇતિહાસ સભ્ય માટે ડેટા એકત્રિત સોફ્ટવેર અપડેટ્સ રીસેટ પિન એન્યુમનેરેશન બ્લોક કાઢી નાખો સ્પષ્ટ ઉપકરણ આરએસબીવાય કૌટુંબિક શોધ પૂર્વદર્શન અનલૉક રીસેટ ઘરગથ્થુ કાર્ડ વાંચો શોધ સભ્ય આયાત આરએસબીવાય કાર્ડ સમન્વયન ઘરગથ્થુ એસાઈન્ડ લોકેશન હેડ જુની હેડ ઘરવપરાશની હુંડી # સૉર્ટ નામ દ્વારા સૉર્ટ કરો ફૂલદાની દ્વારા સૉર્ટ કરો ફરી સમન્વયન કોઈ બાકી આધાર માન્ય કરવા છે માન્ય સફળતા # માન્ય નિષ્ફળ # તમારો તમામ ડેટા અને કામ ખોવાઈ જશે. કાઢી નાખવાની પુષ્ટિ કરો કૃપા કરીને આધાર વિગતો કેપ્ચર પિન અને પુષ્ટિ મેળ ખાતા નથી પસંદ કુટુંબ નવા વડા કોઈ સભ્ય નવા વડા પસંદ કરવા માટે જોવા મળે છે. છબી કેપ્ચર કરવામાં અસમર્થ જરૂરી પરવાનગી આપો; ફરીથી પ્રયત્ન કરો છબી કેપ્ચર કરવામાં અસમર્થ જરૂરી પરવાનગી આપો; ફરીથી પ્રયત્ન કરો... સરકારી ID નંબર દાખલ કરો સરકારી ID તરીકે નામ દાખલ કરો સરકારી ID ફોટો કેપ્ચર કૃપા કરીને 24-અંક નોંધણી ID દાખલ નોંધણી ID તરીકે નામ દાખલ કરો મતદાર ID નંબર દાખલ કરો માં મતદાર ID તરીકે નામ દાખલ કરો રેશનની કાર્ડ નંબર દાખલ કરો રાશન કાર્ડ તરીકે નામ દાખલ કરો NREGA કામ કાર્ડ નંબર દાખલ કરો NREGA કામ કાર્ડ તરીકે નામ દાખલ કરો ડ્રાઇવિંગ લાયસન્સ નંબર દાખલ કરો ડ્રાઇવિંગ લાયસન્સ તરીકે નામ દાખલ કરો જન્મ પ્રમાણપત્ર નંબર દાખલ કરો જન્મ પ્રમાણપત્ર તરીકે નામ દાખલ કરો દાખલ ID નંબર આઈડી તરીકે નામ દાખલ કરો માન્ય મોબાઇલ નંબર દાખલ કરો. તમારો મોબાઇલ નંબર દાખલ કરો. યોજના નંબર દાખલ કરો દાખલ કરો 17 આંકડાના ફૂલદાની સંખ્યા તમે છો એક માન્યકર્તા તરીકે સ્તર user.Please લૉગિન અસક્રિય વપરાશકર્તા માન્ય / નોન માન્ય સભ્યના વાલી નામ દાખલ કરો નોમિની નામ દાખલ કરો સંબંધ નામ દાખલ કરો પસંદ મોબાઇલ નંબર આવતી સ્વયં કૌટુંબિક અન્ય 10-અંકનો મોબાઇલ નંબર દાખલ કરો માન્ય મોબાઇલ નંબર દાખલ કરો જેની મોબાઇલ નંબર પસંદ કરો તમે માન્યકર્તા મોબાઇલ નંબર દાખલ કર્યો છે. વધુ આગળ વધવા માટે ઘરના મોબાઇલ નંબર દાખલ કરો. મહેરબાની કરીને ફરીથી પ્રયતન કરો કૃપા કરીને સભ્ય ફોટો લેવા ગણતરી બ્લોક # ગામ \ - વાર્ડ - નગર- ત્યાં સમન્વયિત કરવા માટે કોઈ ઘરોમાં છે સભ્ય વિગતવાર કુટુંબ સભ્ય વડા મૃત્યુ પામ્યા ન કરવો જોઇએ કે સ્થળાંતર કૃપા કરીને આદર સાથે સંબંધ પસંદ ઘરગથ્થુ કાર્ડ પ્રિન્ટ માટે પાત્ર નથી
